import React from "react"

export class Difficulty extends React.Component {
    constructor() {
        super();
        this.state = {
            level: ""
        };
    }

    handleChange = (event) => {
        console.log(event.target.value);
        this.setState({
            level: event.target.value
        });
    };

    render() {
        console.log(this.state.level);
        return (
            <div
                className="difficulty">
                <label
                    className="difficulty-level">
                    Easy
                    <input
                        className="difficulty-radio"
                        name="level"
                        type="radio"
                        value="easy"
                        defaultChecked
                        onChange={this.handleChange.bind(this)}
                    />
                </label>
                <label
                    className="difficulty-level">
                    Medium
                    <input
                        className="difficulty-radio"
                        name="level"
                        type="radio"
                        value="medium"
                        onChange={this.handleChange.bind(this)}
                    />
                </label>
                <label
                    className="difficulty-level">
                    Hard
                    <input
                        className="difficulty-radio"
                        name="level"
                        type="radio"
                        value="hard"
                        onChange={this.handleChange.bind(this)}
                    />
                </label>
                <label
                    className="difficulty-level">
                    Crazy
                    <input
                        className="difficulty-radio"
                        name="level"
                        type="radio"
                        value="crazy"
                        onChange={this.handleChange.bind(this)}
                    />
                </label>
                <label
                    className="difficulty-level">
                    Insane
                    <input
                        className="difficulty-radio"
                        name="level"
                        type="radio"
                        value="insane"
                        onChange={this.handleChange.bind(this)}
                    />
                </label>
            </div>
        )
    }
}
